--[[
:序号
dwId:id编号
dwClassId:buff组
szIcon:图标
DwNameId:名称字符串ID
DwExplainId:描述字符串ID
szShowId:特效ID
dwSaveId:buff队列:作者:
影响该buff到底储存在玩家哪一组buff队列里面
1增益BUFF
2减益BUFF
3不在客户端显示
bIsAlong:是否独立计算:作者:
0为独立
1为非独立
dwChangeRule:顶替规则:作者:
--0：不可顶替
--1：等级替换
--2：共存叠加
--3：值叠加
--4：时间叠加
dwTroopShow:队列数量显示
bIsLogoutSave:下线是否保存:作者:
下线是否保存 1为保存
bIsLogoutLast:下线是否计时:作者:
1为计时
bIsDead:死亡保存:作者:
1为死亡时不保存
bBackBlood:显示value:作者:
1为显示value，2为不显示value
dwActionId:为动作id
dwBackType:1为回血，2为回蓝  3为宠物回血
dwBeView:0为可查看，1为不可查看
dwBuffType:BUFF生命周期
showTime:显示buff具体时间
dwVariety:BUFF类型:作者:
1增益
2减益
3减益但不执行抵抗体系
dwDupl:副本BUFF:作者:
当副本结束时，清掉这个字段值为 1 的BUFF
vip:VIP:作者:
VIP为0  其他为1
dwCommercialType:商业化buff:1 为商业化 0 为非商业化

--]]
